import { Button } from "react-bootstrap"
import styles from './Card.module.scss'
import { useDispatch } from "react-redux"
import { deleteTableRequest } from '../../redux/tablesRedux'

export const Card = props => {
    const table = props.table
    const dispatch = useDispatch()
    const deleteTable = () => {
        dispatch(deleteTableRequest(table.id))
    }
    return (
        <div className="d-flex justify-content-between">
            <div>
            <h2 className="d-inline">Table {table.id}</h2>
            <p  className="d-inline p-3"><span className={"d-inline " + styles.boldParagraph}>Status: </span>{table.status}</p>
            </div>
            <div>
            <Button variant="primary" className="mx-3" onClick={deleteTable}>Delete tabel</Button>
            <Button variant="primary"><a href={"/edit_table/" + table.id} className="text-light text-decoration-none">Show more</a></Button>
            </div>
        </div>
    )
}
